import React from "react";
import Card from "./card.jsx";

const ListCards = ({ robots }) => {
    if(true){
        throw new console.error();
        
    }
  return (
    <div>
      {robots.map((robot, i) => {
        return (
          <Card
            key={i}
            id={robots[i].id}
            name={robots[i].name}
            email={robots[i].email}
          />
        );
      })}
    </div>
  );
};

export default ListCards;
